import React from "react";

import App from "./App";
import carddetail from "./Array";
 function Cards(){
return(<>
    {carddetail.map(function(value){
        return(
            <App imsrc={value.imgsrc} name={value.name}/>
        )
    })}
    </>
)} ;
 export default Cards;
